type VerifyWithdrawCredential struct {
	OracleTimestamp       uint64
	StateRootProof        Restaking.BeaconChainProofsStateRootProof
	ValidatorIndices      []*big.Int
	ValidatorFieldsProofs [][]byte
	ValidatorFields       [][][32]byte
}

